DROP TABLE JR_REGION;
CREATE TABLE JR_REGION (REGION_ID NUMBER(10) NOT NULL, CODE VARCHAR2(255 CHAR), DISTRICTCODE VARCHAR2(255 CHAR), FULL_NAME VARCHAR2(255 CHAR), NAME VARCHAR2(255 CHAR), POSTCODE VARCHAR2(255 CHAR), SHORTNAME1 VARCHAR2(255 CHAR), SHORTNAME2 VARCHAR2(255 CHAR), SHORTNAME3 VARCHAR2(255 CHAR), PARENT_REGION_ID NUMBER(10), ZONING_ID NUMBER(10), PRIMARY KEY (REGION_ID), CONSTRAINT SYS_C0034136 UNIQUE (CODE));
